import React from 'react';
import { Typography, Grid, Button } from '@material-ui/core';
import { Box } from '@mui/material';
import './Home.css';

function Home() {
    return (
        <>
            <Grid xs={12} justifyContent="center" alignItems="center">
                <Box >
                    <a>
                        <img src='https://i.imgur.com/xgfnlZh.png'></img>
                    </a>
                </Box>
            </Grid>
        </>
    );
}

export default Home;
